def cleantickers(list,manualexclude,manualadd):
    dictionary = enchant.Dict("en_US")
    for ticker in list:
        if dictionary.check(ticker) == True or ticker in manualexclude:
            list.remove(ticker)
    for item in manualadd:
        list.append(item)
    return list

