def analyzecsv(inputcsvfilename, outputcsvfilename, stocklist):
    mentions = []
    mentions_counted = []
    printout = []
    open(outputcsvfilename, 'w').close()
    with open(inputcsvfilename, mode='r', encoding='utf-8-sig') as file:
        reader = csv.reader(file)
        #next(reader)
        for col in reader:
            collumnwords = col[0].split()
            for word in collumnwords:
                if word in stocklist:
                    mentions.append(word)
                    print("Detected: " + word + " In " + inputcsvfilename + " Appending To " + outputcsvfilename) #testing
    open(outputcsvfilename, 'w').close()
    with open(outputcsvfilename, 'a+') as mentionfile:
        writer = csv.writer(mentionfile, delimiter='\n')
        hourheader = outputcsvfilename.split('/')
        hourheader = hourheader[-1]
        hourheader = hourheader.strip('mentions.csv')
        writer.writerow(['Ticker,'+hourheader])
        for item in mentions:
            number = mentions.count(item)
            mentions_counted.append((item,number))
        mentions = list(dict.fromkeys(mentions))
        mentions_counted = list(dict.fromkeys(mentions_counted))
        for i in mentions_counted:
            printline = '%s,%d' % i
            printout.append(printline)
        writer.writerow(printout)

